import '../css/style.scss';
import Navigation from '../component/Navigation';
import ForumBackground from '../../../shared/images/forum-background.png';

const Forum = () => {
  return (
    <div className="forum" style={{ backgroundImage: `url(${ForumBackground})` }}>
      <p className="forum__header-text"><span className="forum__header-text--blue">ELYFI</span>Forum</p>
    </div>
  );
}

export default Forum;
